import React from "react";
import * as modelStyle from "./ModelWindow.module.js";
const ModelWindow = (props) => {
  return (
    <div>
      <div class={modelStyle['modal-backdrop']}></div>
      <div class={modelStyle['modal-window']}>
        <div class={modelStyle['modal-header']}>
          <h2>Error message</h2>
        </div>
        <div class="modal-body">
          <p class="error-message">
            There was an error processing your request.
          </p>
        </div>
      </div>
    </div>
  );
};
export default ModelWindow;
